description:
Category	Feature

Starring	Kayden Kross, James Deen, Evan Stone, Tommy Gunn, Mackenzee Pierce, Marcus London, Bill Bailey, Adrianna Luna, Yurizan Beltran, Christy Mack, Tony Ribas

With the bank threatening to foreclose, operating a food truck wasn't the best solution for Kayden Kross, unless you're serving the 'special'. Adrianna Luna helps turn Kayden's luck around by putting her delicious self on the lunch menu. When Kayden tries, it gets her a night in the slammer. When she is offered a 'get out of jail free card' by Officer Bill Bailey, Kayden loses her chance to Christy Mack &amp; Yurizan Beltran, who fuck their way to freedom.


